import React,{Component} from "react";
import Children from "./Children";
import "./App.css"

class App extends Component {
  constructor(){
    super();
    this.state = { 
      arr:[
        {
          f_name:"reda", l_name:"eskouni", age:26, 
          email:"redaEskouni@gmail.com", 
          user_name:"RedaEskouni",date: new Date
        },
        {
          f_name :"adil", l_name :"eskouni", age:25,
          email :"adilEskouni@gmail.com",
          user_name:"adilEskouni00",
        },
      ]
    }
  }  

  render(){   
    const info = this.state.arr.map(e => 
        <Children  
          f_name={e.f_name}  
          l_name={e.l_name}  
          age={e.age} 
          email={e.email} 
          user_name={e.user_name}
        />)

    return (
      <div className="App">
          {info}
      </div>
    );
  }
}

export default App;
